import React, {Component} from 'react';
import ScrollToTop from './ScrollToTop';

class Sources extends Component {
    render(){
        return(
            <div>
            <hr />
                <h1>Sources</h1>
            <hr />
                    <h2> <a href='https://www.udemy.com/course/react-js-and-redux-mastering-web-apps/'>Udemy - "React JS Web Development - The Essentials Bootcamp"</a></h2>
                    <h2> <a href='https://www.w3schools.com/react/react_css.asp'>w3 Schools</a></h2>
                    <h2> <a href='https://stackoverflow.com/questions/18665171/how-to-make-the-main-content-div-fill-height-of-screen-with-css'>Stack Overflow</a></h2>
                    <h2> <a href='https://reactjs.org/'>React</a></h2>
                    <h2> <a href='https://www.sitepoint.com/community/t/help-with-bullet-list-alignment-needed-please/44332'>sitepoint</a></h2>
                    <h2> <a href='https://www.c-sharpcorner.com/article/what-and-why-reactjs/'>C# Corner</a></h2>
                    <h2> <a href='https://research.hackerrank.com/developer-skills/2019/'>HackerRank</a></h2>
                    <h2> <a href='https://netflixtechblog.com/netflix-likes-react-509675426db'>The Netflix Tech Blog</a></h2>
                    <h2> <a href='https://www.businessfast.co.uk/8-tech-companies-discuss-the-advantages-of-using-react-js-built-in/'>BusinessFast</a></h2>

           
            </div>

        )
    }
} export default Sources;
